async (key: string) => {
  // console.log("reading key ", key);
  try {
    const item = await AsyncStorage.getItem(key);
    const value = item ? JSON.parse(item) : undefined;
    // console.log(`we got ${item}`);
    return value;
  } catch (e) {
    // error reading value
    console.warn(
      `Something went wrong with asyncStorage from useStore (key ${key})`,
      e
    );
  }
}
